/*Table structure for table `lv_bsroom` */

DROP TABLE IF EXISTS `lv_bsroom`;

CREATE TABLE `lv_bsroom` (
                             `id` varchar(50) NOT NULL,
                             `roomid` varchar(45) NOT NULL,
                             `name` varchar(45) NOT NULL COMMENT '电梯、无线网络、洗衣机等信息',
                             `rtype` varchar(45) NOT NULL COMMENT '服务、休闲娱乐、基础设施、卫浴、厨房、周边、安全几类',
                             `ideleted` smallint(6) DEFAULT NULL,
                             `createon` varchar(100) DEFAULT NULL,
                             `createby` varchar(45) DEFAULT NULL,
                             `modifyon` varchar(100) DEFAULT NULL,
                             `val` varchar(45) NOT NULL,
                             PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `lv_bsroom` */

/*Table structure for table `lv_city` */

DROP TABLE IF EXISTS `lv_city`;

CREATE TABLE `lv_city` (
                           `id` bigint(20) NOT NULL COMMENT 'id',
                           `name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '名称',
                           `ishot` int(11) NOT NULL DEFAULT '0' COMMENT '是否是热门城市：1是 0不是',
                           `parentid` bigint(20) NOT NULL COMMENT '父城市id',
                           `logtude` decimal(8,3) NOT NULL COMMENT '经度',
                           `latttude` decimal(8,3) NOT NULL COMMENT '维度',
                           `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
                           `create_dept` bigint(20) DEFAULT NULL COMMENT '创建部门',
                           `create_by` bigint(20) DEFAULT NULL COMMENT '创建人',
                           `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                           `update_by` bigint(20) DEFAULT NULL COMMENT '更新者',
                           `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                           PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

